import NavItem from 'react-bootstrap/esm/NavItem';
import '../App.css';
import tileImg from '../img/image.png';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import { useEffect, useState } from 'react';

function Home() {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [modalState, setModalState] = useState(false);
  const [alertState, setAlertState] = useState(false);
  const [loginData, setLoginData] = useState({
    login: '',
    password: ''
  });

  const handleClose = () => {setModalState(false); alert(loginData.login)};
  const handleOpen = () => setModalState(true);
  const handleLogin = () => {
    const regex = /^.{4,10}$/;
    const regex_login = /^.{4,20}$/;
    if (regex.test(loginData.password) && regex_login.test(loginData.login)) {
        alert('Отправлено');
        handleClose();
    } else {
        setAlertState(true);
    }
  };

 

  return (
    <div className='app-container'>
        <header className='Home-header'>
            <h6 style={{marginLeft: 100, fontSize: 24}}>Транспонатор нот</h6>
            <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
                <a style={{fontSize: 24, display: 'flex', justifyContent: 'center', alignItems: 'center', height: 35, background:'white', outlineColor:'white', cursor:'pointer'}} onClick={handleOpen}>Вход</a>
                <Button style={{marginLeft: 20, marginRight: 100, fontSize: 24, height: 35, display: 'flex', justifyContent: 'center', alignItems: 'center', color:'#1B9A46', outlineColor: '#1B9A46', background: 'white', borderColor: '#1B9A46'}}>Регистрация</Button>
            </div>
        </header>
        <main className='Home-body'>
            <h4 style={{fontSize: 32}}>Онлайн транспонирование нот</h4>
            <p style={{fontSize: 20}}>Ноты из любого произведения для любого инструмента</p>
            
            <div style={{ display: 'flex', justifyContent: 'center', marginBottom: 50}}>
                <div className='Home-tile'>
                    <Button className='Home-tile-button' style={{color:'white', background: '#1B9A46', borderColor: '#1B9A46'}}>Загрузить файл</Button>
                    <p style={{color: '#C8C8C8'}}>Перетащите сюда MP3 файл. Максимальный размер файла - 78 мб</p>
                </div>
            </div>
        </main>
        <footer className='Home-footer'>
            <div style={{color: 'white', padding: '10px'}}>
                huesos.net
            </div>
            <div style={{display: 'flex', justifyContent: 'center'}}>
                <a style={{color:'white', padding: '10px'}}>О нас</a>
                <a style={{color:'white', padding: '10px'}}>Безопасность</a>
                <a style={{color:'white', padding: '10px'}}>Стоимость</a>
                <a style={{color:'white', padding: '10px'}}>Помощь</a>
            </div>
            <div style={{color: 'white', padding: '10px'}}>
                Язык в попе
            </div>
        </footer>
        <Modal show={modalState} onHide={handleClose} backdrop="static" keyboard={true}>
            <Modal.Header closeButton>
            <Modal.Title>Вход</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <Form>
                    <Form.Group className='mb-3'>
                        <Form.Label>Имя пользователя</Form.Label>
                        <Form.Control onChange={(e)=>{e.preventDefault(); loginData.login = e.target.value}} type='login'></Form.Control>
                    </Form.Group>
                    <Form.Group className='mb-3'>
                        <Form.Label>Пароль</Form.Label>
                        <Form.Control onChange={(e)=>{e.preventDefault(); loginData.password = e.target.value}} type='password'></Form.Control>
                    </Form.Group>
                    {alertState && <p>От 4 до 10</p>} 
                </Form>
            </Modal.Body>
            <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
                Закрыть окно
            </Button>
            <Button variant="primary" onClick={handleLogin}>
                Войти
            </Button>
            </Modal.Footer>
        </Modal>
    </div>
  );
}

export default Home;
